 "Include Single Page export file?": "\u00bfIncluir el fichero exportado como p\u00e1gina html \u00fanica?", 
 "Panjabi; Punjabi ": "Panjabi; punjabi ", 
 "<p>Teachers should keep the following in mind when using this iDevice: <\/p><ol><li>Think about the number of different types of activity planned for your resource that will be visually signalled in the content. Avoid using too many different types or classification of activities otherwise learner may become confused. Usually three or four different types are more than adequate for a teaching resource.<\/li><li>From a visual design perspective, avoid having two iDevices immediately following each other without any text in between. If this is required, rather collapse two questions or events into one iDevice. <\/li><li>Think about activities where the perceived benefit of doing the activity outweighs the time and effort it will take to complete the activity. <\/li><\/ol>": "<p>Los profesores deben recordar lo siguiente cuando est\u00e9n usando este iDevice:<\/p><ol><li>Piense en la cantidad de diferentes tipos de actividades planificados como recurso los cuales ser\u00e1n se\u00f1alados visualmente como contenido. Trate de no usar muchos diferentes tipos de clasificaciones de actividades, para que el estudiante no se confunda. Normalmente tres o cuatro diferentes tipos son m\u00e1s que suficiente por un recurso de ense\u00f1anza.<\/li><li>Desde una perspectiva de dise\u00f1o visual, trata de no poner dos iDevices juntos sin texto entre medias. Si se encuentra que es necesario, una dos preguntas y eventos en un iDevice.<\/li><li>Plant\u00e9ese actividades en las que el beneficio de completar la actividad supere al costo en tiempo y esfuerzo de completarla.<\/li><\/ol>", 
