 "Typically, Date will be associated with the creation or availability of the resource. Recommended best practice for encoding the date value is defined in a profile called <em>ISO 8601<\/em> <a href=\"\/docs\/W3C-NOTE-datetime.html\" target=\"_blank\">W3C Date and Time Formats<\/a> and includes (among others) dates of the form YYYY-MM-DD.": "T\u00edpicamente, la FECHA estar\u00e1 asociada con la creaci\u00f3n o disponibilidad del recurso. La pr\u00e1ctica recomendada para codificar el valor de la fecha est\u00e1 definida en un perfil llamado <em>ISO 8601<\/em> <a href=\"\/docs\/W3C-NOTE-datetime.html\" target=\"_blank\">Formatos de fecha y hora del W3C<\/a> e incluye (entre otras) las fechas de la forma AAAA-MM-DD.", 
