 "False": "Falso", 
 "<p>Enter the text for the dropdown activity in to the dropdown field \nby either pasting text from another source or by typing text directly into the \nfield.<\/p><p> To select words to choose, double click on the word to select it and \nclick on the 'Hide\/Show' button below.<\/p>": "<p>Introduzca el texto para la actividad desplegable en el campo desplegable\nbien pegando el texto desde otra fuente o bien tecle\u00e1ndolo directamente en el\ncampo.<\/p><p>Para seleccionar qu\u00e9 palabras da a elegir, haga doble clic sobre una palabra para\nseleccionarla y pulse en el bot\u00f3n 'Mostrar\/Ocultar' de abajo.<\/p>", 
 "Common Cartridge": "Paquete Common Cartridge", 
 "Afrikaans ": "Afrikaans ", 
 "<p>Assign a label for the attachment. It is useful to include the type of file. Eg. pdf, ppt, etc.<\/p><p>Including the size is also recommended so that after your package is exported to a web site, people will have an idea how long it would take to download this attachment.<\/p><p>For example: <code>Sales Forecast.doc (500kb)<\/code><\/p>": "<p>Asigne una etiqueta al adjunto. Es \u00fatil incluir el tipo de archivo. Ej. pdf, ppt, etc.<\/p><p>Tambi\u00e9n se recomienda incluir el tama\u00f1o de forma que despu\u00e9s de que su paquete se exporte a un sitio web, se tenga una idea sobre cu\u00e1nto tiempo supondr\u00eda la descarga de este adjunto. <\/p><p>Por ejemplo:<code>Previsi\u00f3n de Ventas.doc (500kb)<\/code><\/p>", 
