 "<p>Enter the text for the cloze activity in to the cloze field \nby either pasting text from another source or by typing text directly into the \nfield.<\/p><p> To select words to hide, double click on the word to select it and \nclick on the Hide\/Show Word button below.<\/p>": "<p>Escriba el texto para la actividad de rellenar huecos dentro del campo hueco \nbien pegando texto de otra fuente o tecleando el texto directamente en el campo.<\/p>\n<p>Para seleccionar las palabras a esconder, haga doble clic en la palabra para seleccionarla,\ny pulse en el bot\u00f3n Esconder\/Mostrar Palabra de abajo.<\/p>", 
