 "Unlike the MCQ the SCORM quiz is used to test \nthe learners knowledge on a topic without providing the learner with feedback \nto the correct answer. The quiz will often be given once the learner has had \ntime to learn and practice using the information or skill.\n ": "A diferencia de la Pregunta de Elecci\u00f3n M\u00faltiple, el cuestionario SCORM se utiliza para probar \nel conocimiento de los estudiantes sobre un tema sin ofrecer como retroalimentaci\u00f3n \nla respuesta correcta. El ejercicio deber\u00eda presentarse una vez que los estudiantes han tenido \ntiempo de aprender y practicar.\n ", 
