 "Reflection is a teaching method often used to \nconnect theory to practice. Reflection tasks often provide learners with an \nopportunity to observe and reflect on their observations before presenting \nthese as a piece of academic work. Journals, diaries, profiles and portfolios \nare useful tools for collecting observation data. Rubrics and guides can be \neffective feedback tools.": "La reflexi\u00f3n es un m\u00e9todo de ense\u00f1anza usado a menudo\npara conectar la teor\u00eda con la pr\u00e1ctica. Las tareas de reflexi\u00f3n ofrecen a menudo a los estudiantes\nla oportunidad a observar y reflejar sus observaciones antes de presentar una parte\nde un trabajo acad\u00e9mico. Diarios, perfiles y portafolios son herramientas \u00fatiles para\nrecoger datos de la observaci\u00f3n. Las r\u00fabricas y las gu\u00edas pueden ser herramientas\neficaces de la informaci\u00f3n.", 
