 "Button Caption": "T\u00edtulo del bot\u00f3n", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Choose words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl><dt>Si su objetivo es evaluar la comprensi\u00f3n de los conceptos clave de un curso, o la comprensi\u00f3n lectora<\/dt><dd><p>Escriba un resumen del concepto o lectura lo suficientemente largo como para que eval\u00fae adecuadamente el conocimiento del objetivo, pero lo suficientemente corto como para que no produzca fatiga. Probablemente una p\u00e1gina impresa sea un tama\u00f1o adecuado, pero considere la posibilidad de utilizar un texto menor para ni\u00f1os o principiantes.<\/p> <p>Elija palabras del texto que sean claves para la comprensi\u00f3n de los conceptos. Estas ser\u00e1n probablemente verbos, sustantivos y adverbios clave. Escoja alternativas con una respuesta clara.<\/p><\/dd> <dt>Si su objetivo es evaluar el conocimiento de vocabulario<\/dt><dt>Si su objetivo es evaluar morfolog\u00eda o gram\u00e1tica: <\/dt><dd><p>Escriba un texto en el que se usen las formas que quiere evaluar. Este texto debe ser coherente y de sentido completo, y de una longitud apropiada. Recuerde que en este caso el objetivo no es evaluar el conocimiento de vocabulario, y por tanto los significados b\u00e1sicos de las ra\u00edces deben ser bien conocidos por los estudiantes. \u00a1Es buena idea pedir a un compa\u00f1ero docente que realice el control\/ejercicio, para asegurarse de que no se producen sorpresas!<\/p><\/dd><\/dl>", 
