 "XLIFF export options": "Opciones de exportaci\u00f3n a XLIFF", 
 "<dl>  <dt>If your goal is to test understanding of core concepts or reading comprehension  <\/dt>  <dd>    <p>  Write a summary of the concept or reading long  enough to adequately test the target's knowledge, but short enough not to induce fatigue. Less than one typed page is probably adequate, but probably considerably less for young students or beginners.    <\/p>    <p>Select words in the text thatare key to understanding the concepts. Thesewill probably be verbs, nouns, and key adverbs.Choose alternatives with one clear answer.    <\/p>  <\/dd>  <dt>If your goal is to test vocabulary knowledge  <\/dt>  <dd><p>Write a text using the target vocabulary. This text should be coherent and cohesive, and be of an appropriate length. Highlight the target words in the text. Choose alternatives with one clear answer.<\/p>  <\/dd>  <dt>If your goal is to test word formation\/grammar:  <\/dt>  <dd>  <p>Write a text using the target forms. This text should be coherent and cohesive, and be of an appropriate length. Remember that the goal is not vocabulary knowledge, so the core meanings of the stem words should be well known to the students.  <\/p>  <p>Highlight the target words in the text. Provide alternatives with the same word stem, but different affixes. It is a good idea to get a colleague to test the test\/exercise to make sure there are no surprises!  <\/p>  <\/dd><\/dl>": "<dl>  <dt>Si su objetivo es evaluar la comprensi\u00f3n de los conceptos de base o la comprensi\u00f3n lectora  <\/dt>  <dd>    <p>  Escriba un resumen del concepto o lectura suficientemente extenso para que su longitud sea adecuada para evaluar el conocimiento que se quiere comprobar, pero suficientemente corto para no inducir fatiga. Menos de una p\u00e1gina es probablemente adecuado, pero debe considerar menos para estudiantes j\u00f3venes o principiantes.    <\/p>    <p>Seleccione palabras en el texto que sean claves para entender los conceptos. Estas ser\u00e1n probablemente verbos, sustantivos y adverbios clave. Elija alternativas con una respuesta clara.    <\/p>  <\/dd>  <dt>Si su meta es probar el conocimiento de vocabulario  <\/dt>  <dd><p>Escriba un texto en el que use el vocabulario cuyo dominio que quiere evaluar. Este texto deber\u00eda ser coherente y tener una unidad, y de una longitud apropiada. Resalte las palabras importantes en el texto. Escoja alternativas que no induzcan a confusiones.<\/p>  <\/dd>  <dt>Si su objetivo es evaluar la morfolog\u00eda o la gram\u00e1tica:  <\/dt>  <dd>  <p>Escriba un texto considerando estos objetivos. Este texto deber\u00eda ser coherente y tener una unidad y una longitud apropiada. Recuerde que el objetivo no es el conocimiento del vocabulario, y por lo tanto los estudiantes deben conocer ya el significado esencial de las ra\u00edces de los t\u00e9rminos usados.  <\/p>  <p>Resalte las palabras que quiera evaluar del texto. Proporcione alternativas con la misma ra\u00edz, pero con diferentes afijos. \u00a1Es una buena idea conseguir que un colega pruebe los ejercicios para asegurarse de que no haya sorpresas!  <\/p> <\/dd><\/dl>", 
